pragma solidity ^0.4.24;
contract MyToken{
    
    string public constant symbol ="VIN";
    string public constant name ="Token-226";
    uint public constant decimals=10;
    
    uint private  __tokenSupply=100000;
    mapping(address=>uint) private  __balanceOf;
    mapping(address=>mapping(address=> uint)) private __allowances;
    function totalSupply() constant public returns(uint _totalsupply){
    return _totalsupply=__tokenSupply;
    }  
    
    function balanceOf(address _addr) constant returns(uint balance){
        return __balanceOf[_addr];
    }
    function transfer(address _to,uint _value) returns(bool success){
        if(_value > 0 && _value<=balanceOf(msg.sender)){
            __balanceOf[msg.sender]-=_value;
            __balanceOf[_to] +=_value;
            return true;
        }
        return false;
    }
    
    function transferFrom(address _from ,address _to,uint _value) returns(bool success){
        if(__allowances[_from][msg.sender] > 0 && _value > 0 &&__allowances[_from][msg.sender] >=_value){
            __balanceOf[_from]-=_value;
            __balanceOf[_to]+=_value;
            return true;
        } 
        return false;
    }
    
    function approve(address _spender,uint _value) returns(bool success){
        __allowances[msg.sender][_spender]=_value;
        return true;
        
    }
    function allowanceof(address _owner,address _spender) constant returns(uint remaining){
      
            return __allowances[_owner][_spender];
       
        
    }
}
